import React from 'react';
import drinks from './drinks.jpg'
import './Body.css'
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import axios from 'axios'


function Adminlist (props)  {

    function handleClick() {
        console.log('Button click ...');
        console.log(props._id) 

        axios.get(`http://localhost:5000/admin/chefs/delete/${props._id}`, {
        // axios.get(`admin/chefs/delete/${props._id}`, {
            headers: {
              'auth-token': localStorage.usertoken
            }})
         .then(res => {
             if(res.data.status==true){
                this.setState({orders: res.data.data.product}) 
                }
                else if(res.data.status==false){
                    // alert(res.data.error)
                    toast(res.data.error, {position: toast.POSITION.TOP_CENTER, autoClose: 1000});
                } 
         })
    }

    return (   
                
        <div className="item col-md-3 col-sm-6" style={{textAlign:'left', border:'solid', marginRight:'2%', marginTop:'2%', paddingTop:'3%', borderRadius:'10px', backgroundColor:'white'}}>
                    <p><b>ID : {props._id}</b></p>
                    <p><b>Username : {props.username}</b></p>
                    <p><b>Name : {props.name}</b></p>
                    <p><b>Address : {props.address}</b></p>
                    <p><b>Phone : {props.phone}</b></p>
                    <p><b>Email : {props.email}</b></p>
                    <p><button className='btn btn-primary' type="button" onClick={handleClick}  variant="primary" style={{borderRadius:'10px',width:'auto',height:'auto'}}>Remove Account</button></p> 
                </div>  

    )   
    
    }

export default Adminlist;
